import { Component } from "react";
import React from "react";
import { Header } from './Header.js'
import { ExportCSV } from './ExportCSV.js'

class PatientEntryForm extends Component {

    constructor(props) {
        super(props);
        this.state = {
            patientName: "",
            age: 0,
            symptoms: "",
            comments: "",
            roomNumber: 0,
        };
        this.handleInputChange = this.handleInputChange.bind(this);
        this.addPatientRequest = this.addPatientRequest(this); //This sends a post request forever...
    }

    handleInputChange(event) {
        const target = event.target;
        const value = target.type === 'checkbox' ? target.checked : target.value;
        const name = target.name;
        this.setState({
            [name]: value
        });

        console.log(this.state)

    }

    addPatientRequest(event) {
        //event.preventDefault();
        fetch('/api/v1/patients/', {
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({

                name: this.state.patientName, age: this.state.age,
                symptoms: this.state.symptoms, comments: this.state.comments,
                room_number: this.state.roomNumber
                /*
                name: "sdf", age: "234",
                symptoms: "asdf", comments: "sdf",
                room_number: "234"*/
            })
        })
            .then(res => res.json())
            .then(
                (result) => {
                    console.log("Yeet")
                    console.log(result)
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    console.log("Fail")
                    console.log(error)
                }
            )
    }

    render() {
        return (
            <div className="App">
                <div className="row">
                    <div className="col-md-12">
                        <ExportCSV csvData={this.patients} fileName={this.state.fileName} />
                    </div>
                    <div className="col-md-4" class="m-5">
                        <form>
                            <div class="form-group">
                                <label for="patientName">Patient Name: </label>
                                <input
                                    name="patientName"
                                    class="form-control"
                                    id="patientName"
                                    type="string"
                                    placeholder="Enter patient name"
                                    value={this.state.patientName}
                                    onChange={this.handleInputChange} />
                            </div>
                            <div class="form-group">
                                <label for="patientAge">Patient Age: </label>
                                <input
                                    name="age"
                                    class="form-control"
                                    id="patientName"
                                    type="number"
                                    placeholder="Enter patient age"
                                    value={this.state.age}
                                    onChange={this.handleInputChange} />
                            </div>
                            <div class="form-group">
                                <label for="patientSymptoms">Patient Symptoms: </label>
                                <input
                                    name="symptoms"
                                    class="form-control"
                                    id="patientSymptoms"
                                    type="string"
                                    placeholder="Enter patient symptoms"
                                    value={this.state.symptoms}
                                    onChange={this.handleInputChange} />
                            </div>
                            <div class="form-group">
                                <label for="patientComments">Comments: </label>
                                <input
                                    name="comments"
                                    class="form-control"
                                    id="patientComments"
                                    type="string"
                                    placeholder="Comments about patient"
                                    value={this.state.comments}
                                    onChange={this.handleInputChange} />
                            </div>
                            <div class="form-group">
                                <label for="patientRoomNumber">Room Number: </label>
                                <input
                                    name="roomNumber"
                                    class="form-control"
                                    id="patientRoomNumber"
                                    type="number"
                                    placeholder="Enter patient room number"
                                    value={this.state.roomNumber}
                                    onChange={this.handleInputChange} />
                            </div>
                            <button class="btn btn-primary" onClick={this.addPatientRequest} >
                                Add Patient
                            </button>
                        </form>
                    </div>
                </div>
            </div>
        );
    }
}

export default PatientEntryForm;



